import React from "react";

import projectData from "../constants/index"

const Project = () => {
  return (
    <section id="project">
      <div className="project_wrap">

        {projectData.map((project, i)=>(
          <div className="project">
            <div className="project_img">
              {project.img[i]}
            </div>
            <div className="project_info">
              <span>Project 2 : 플라토 커피 주문 앱</span>
              <span>production period : ten days</span>
              <span>use stack : react.js/redux/firebase/mui/bootstrap/figma</span>
              <span>설명</span>
            </div>
          </div>
        ))}

      </div>
    </section>
  );
};

export default Project;
